import React from 'react'
import { useDispatch } from "react-redux";
import DropdownAction from "~/components/elements/basic/DropdownAction";
import { deleteActionCategory } from "~/store/product/action";

function ProductColumn({product, num}) {
      const dispatch = useDispatch()
	// const deleteProduct = () => {
      //   console.log(product.id)

	// 	dispatch(deleteActionCategory(product.id));
	// };
      let badgeView
      if (product) {
            badgeView = <span className="ps-badge success">Stock</span>;
        } else {
            badgeView = <span className="ps-badge gray">Out of stock</span>;
        }
	return (
		<tr>
			<td>{num+1}</td>
			<td>
				<strong>{product.name}</strong>
			</td>
                  <td>{product.description}</td>
			<td>{product.description}</td>
			<td>{product.createdAt}</td>
			{/* <td onClick={deleteCategory}>delete</td> */}
			<td>
				<DropdownAction type="product" id={product.id} key={num+1} />
			</td>
		</tr>
	);
}

export default ProductColumn
